import React, { Component } from 'react';


export default class Arriendos extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }


    render() {
        const { prop } = this.state
        return (
            <div style={boxStyles}>
                <List
                    list={prop}
                />
            </div>
        )
    }

}
